INSERT INTO `bible` VALUES ('Exo-1-0-0','Exo','SOV',1,1,1,0,'මිසරයට පැමිණි ඉශ්‍රායෙල් පුත්‍රයන්ගේ නාමවල් නම්:',NULL,'20191031192740'),('Exo-1-0-1','Exo','SOV',0,1,0,1,'ඉශ්‍රායෙල්වරුන් මිසරයේ වැඩිවීම.',NULL,'20191031192740'),('Exo-1-1-0','Exo','SOV',2,1,2,0,'රූබෙන්, සිමියොන්, ලෙවී සහ යූදා;',NULL,'20191031192740'),('Exo-1-10-0','Exo','SOV',11,1,11,0,'එසේ හෙයින් ඔව්හු බර වැඩ පැවරීමෙන් ඔවුන්ට පීඩාකරන පිණිස ඔවුන් කෙරෙහි විධානවරුන් පත්කළෝය. ඔව්හු පිථොම් සහ රාම්සෙස්නම් ගබඩා නුවරවල්\nඵාරාවෝ හට ගොඩනැගුවෝය.',NULL,'20191031192740'),('Exo-1-11-0','Exo','SOV',12,1,12,0,'නුමුත් ඔවුන්ට පීඩා කරන්ට කරන්ට ඔව්හු වඩ වඩා බෝවී වඩ වඩා පැතිරගියෝය. මිසරවරු ඉශ්‍රායෙල් පුත්‍රයන් නිසා බේදයට පත්ව',NULL,'20191031192740'),('Exo-1-12-0','Exo','SOV',13,1,13,0,'තද ලෙස මෙහෙකරන්ට ඔවුන්ට සැලැස්සුවෝය.',NULL,'20191031192740'),('Exo-1-13-0','Exo','SOV',14,1,14,0,'ඔවුන් යෙදූ තද වැඩ වූ බදාම සහ ගඩොල් වැඩද කෙතෙහි සියලු ආකාර වැඩද ඔවුන් ලවා කෙරෙවූ සියලු තදබල වැඩද කරණකොටගෙන ඔව්හු ඔවුන්ගේ ජීවිතය\nඔවුන්ට තික්ත කළෝය.',NULL,'20191031192740'),('Exo-1-14-0','Exo','SOV',15,1,15,0,'මිසරයේ රජතෙම ෂිප්රාද පුවාද නම්ලත් හෙබ්‍රෙව් වින්නඹුවන්ට කථාකොට:',NULL,'20191031192740'),('Exo-1-15-0','Exo','SOV',16,1,16,0,'නුඹලා හෙබ්‍රෙව් ස්ත්‍රීන්ට වින්නඹුකම් කරන විට, ඔවුන් ප්‍රසූත යහනෙහි ඉන්නවා දකින කල්හි, පුතෙක් නම් ඔහු මරාපල්ලා; දුවක් නම් ඈ\nජීවත්වුණාවේයයි කීවේය.',NULL,'20191031192740'),('Exo-1-16-0','Exo','SOV',17,1,17,0,'එහෙත් වින්නඹුවෝ දෙවියන්වහන්සේට භයවෙමින් මිසරයේ රජු අණදුන් ලෙස නොකොට පිරිමි දරුවන් නොමරා ඉතුරු කළෝය.',NULL,'20191031192740'),('Exo-1-17-0','Exo','SOV',18,1,18,0,'එවිට මිසරයේ රජ වින්නඹුවන් කැඳවා: කුමක්හෙයින් මේ දේ කොට පිරිමි දරුවන් නොමරා ඉතිරි කළහුදැයි ඔවුන්ගෙන් ඇසුවේය.',NULL,'20191031192740'),('Exo-1-18-0','Exo','SOV',19,1,19,0,'වින්නඹුවෝ: හෙබ්‍රෙව් ස්ත්‍රීහු මිසර ස්ත්‍රීන්ට සමාන නොවෙති; ඔව්හු ශක්තිමත් බැවින් වින්නඹුවන් ඔවුන් වෙතට එන්ට පළමුවෙන් වදතියි\nඵාරාවොට කීවෝය.',NULL,'20191031192740'),('Exo-1-19-0','Exo','SOV',20,1,20,0,'ඒ නිසා දෙවියන්වහන්සේ වින්නඹුවන්ට කරුණාව පෙන්වූසේක. සෙනඟද බෝවී අතිශයින් බලවත්වූවෝය.',NULL,'20191031192740'),('Exo-1-2-0','Exo','SOV',3,1,3,0,'ඉස්සාඛර්, සාබුලොන් සහ බෙන්යමින්; දාන් සහ නප්තලී, ගාද් සහ ආෂෙර්ය.',NULL,'20191031192740'),('Exo-1-20-0','Exo','SOV',21,1,21,0,'තවද වින්නඹුවන් දෙවියන්වහන්සේට භයවූ බැවින් උන්වහන්සේ ඔවුන්ට වංශයක් සාදා දුන්සේක.',NULL,'20191031192740'),('Exo-1-21-0','Exo','SOV',22,1,22,0,'එවිට ඵාරාවෝ: උපදින්නාවූ සියලු පුත්‍රයන් ගඟේ දමා සියලු දූවරුන් නොමරා ඉතුරුකරපල්ලායයි තමාගේ මුළු සෙනඟට අණකෙළේය.',NULL,'20191031192740'),('Exo-1-3-0','Exo','SOV',4,1,4,0,'යාකොබ් කැටුව මේ එක එක මනුෂ්‍යයා සහ ඔහුගේ ගෙයි වැසියෝද ආවෝය.',NULL,'20191031192740'),('Exo-1-4-0','Exo','SOV',5,1,5,0,'යාකොබ්ගේ කටියෙන් උපන් සියල්ලෝ සැත්තෑ දෙනෙක්ය. යෝසෙප් මිසරයට ගොස් සිටියේය.',NULL,'20191031192740'),('Exo-1-5-0','Exo','SOV',6,1,6,0,'යෝසෙප්ද ඔහුගේ සියලු සහෝදරයෝද ඒ මුළු පරම්පරාවද මළෝය.',NULL,'20191031192740'),('Exo-1-6-0','Exo','SOV',8,1,8,0,'තවද යෝසෙප් නාඳුනන අලුත් රජෙක් මිසරය කෙරෙහි පත්වුණේය.',NULL,'20191031192740'),('Exo-1-6-1','Exo','SOV',7,1,6,1,'ඔවුන් වාල්ව සිටීම.',NULL,'20191031192740'),('Exo-1-8-0','Exo','SOV',9,1,9,0,'ඔහු තමාගේ සෙනඟට කථාකොට: බලව, ඉශ්‍රායෙල් පුත්‍රයන්ගේ සෙනඟ අපට වඩා බොහෝව වඩා බලවත්ව සිටිති.',NULL,'20191031192740'),('Exo-1-9-0','Exo','SOV',10,1,10,0,'වරලේලා, ඔවුන් බෝනොවන පිණිසත් යම් යුද්ධයක් සිදුවන කල අපේ සතුරන්ට එක්ව අපට විරුද්ධව සටන් කොට දේශයෙන් පිටවී නොයන පිණිසත් ඔවුන් සමග\nනුවණින් ක්‍රියාකරමුයයි කීවේය.',NULL,'20191031192740'),('Exo-10-0-0','Exo','SOV',1,10,1,0,'ස්වාමීන්වහන්සේ මෝසෙස්ට කථාකොට: ඵාරාවෝ වෙතට යව. මක්නිසාද මා විසින් ඵාරාවෝගේ සිතද ඔහුගේ සේවකයන්ගේ සිත්ද දැඩිකළේ ඔවුන් මධ්‍යයෙහි මාගේ\nලකුණු දක්වන පිණිසත්',NULL,'20191031192757'),('Exo-10-0-1','Exo','SOV',0,10,0,1,'8 වෙනි පීඩාව: පළඟැටියෝ.',NULL,'20191031192757'),('Exo-10-1-0','Exo','SOV',2,10,2,0,'මිසරයට මා කළ දේ සහ ඔවුන් අතරේ දැක්වූ මාගේ ලකුණු කුමක්දැයි නුඹේ පුත්‍රයාටත් නුඹේ පුත්‍රයාගේ පුත්‍රයාටත් ඇසෙන පරිද්දෙන් නුඹ විසින්\nකියාදෙන පිණිසත් මම ස්වාමීන්වහන්සේ බව නුඹලා දැනගන්න පිණිසත්යයි කීසේක.',NULL,'20191031192757'),('Exo-10-10-0','Exo','SOV',11,10,11,0,'එසේ නොවේ. නුඹලාගේ පිරිමි පක්ෂය ගොස් ස්වා