ජකයා කිය යුතුය. ඔහු පවිත්‍රය.',NULL,'20191031193740'),('Lev-13-17-0','Lev','SOV',18,13,18,0,'ශරීරයේ හමේ ගඩගෙඩියක් තිබී සුව වුණාට පසු,',NULL,'20191031193740'),('Lev-13-18-0','Lev','SOV',19,13,19,0,'ගඩගෙඩිය තිබුණු තැන සුදු බිබිලක්වත් රතට හුරු සුදු පල්ලක්වත් හටගත්තොත් එය පූජකයාට පෙන්විය යුතුය;',NULL,'20191031193740'),('Lev-13-19-0','Lev','SOV',20,13,20,0,'පූජකයා බැලූ කල එය හමට වඩා පහත්වී එහි මයිල් සුදුවී තිබෙන බව දුටුවොත් ඔහු අපවිත්‍රයයි පූජකයා කිය යුතුය. එය කුෂ්ඨ ලකුණය, ඒක\nගඩගෙඩියෙන් හටගත්තේය.',NULL,'20191031193740'),('Lev-13-2-0','Lev','SOV',3,13,3,0,'පූජකයාද ශරීරයේ හමෙහි රෝගය බලාවා. රෝගය තිබෙන තැන මයිල් සුදුවූ බවද ඒ රෝගය සෑදී තිබෙන ස්ථානය ඔහුගේ ශරීරයේ හමට වඩා පහත්ව තිබෙන බවද\nපෙනේනම් ඒක කුෂ්ඨයේ ලකුණක්ය. පූජකයා ඔහු බලා ඔහු අපවිත්‍රයයි කිය යුතුය.',NULL,'20191031193740'),('Lev-13-20-0','Lev','SOV',21,13,21,0,'එහෙත් පූජකයා එය බැලූ කල එහි තුළ සුදු මයිල් නැතුව හමට වඩා පහත් නොවී මැලවී තිබුණොත් පූජකයා ඔහු සත්දිනක් වෙන්කර සිටුවිය යුතුය.',NULL,'20191031193740'),('Lev-13-21-0','Lev','SOV',22,13,22,0,'ඉදින් ඒක හමේ පැතුරුණොත් ඔහු අපවිත්‍රයයි පූජකයා කිය යුතුය. ඒක කුෂ්ඨ ලකුණක්ය.',NULL,'20191031193740'),('Lev-13-22-0','Lev','SOV',23,13,23,0,'එහෙත් පල්ල පැතිර නොගොස් තිබුණු තැනම නැවතුණොත් ඒක ගඩගෙඩියේ කැලලය; පූජකයා ඔහු පවිත්‍රයයි කියාවා.',NULL,'20191031193740');
INSERT INTO `bible` VALUES ('Lev-13-23-0','Lev','SOV',24,13,24,0,'නොහොත් ශරීරයේ හමෙහි ගින්නෙන් දැවීමක් වූ කල දෑවාවූ තුවාලයේ මාංසය රතට හුරුව සුදු පල්ලක් වන්නේ නම්, පූජකයා ඒක බලාවා.',NULL,'20191031193740'),('Lev-13-24-0','Lev','SOV',25,13,25,0,'එවිට පැල්ලමේ මයිල් සුදුවී ඒක හමට වඩා පහත් බව පෙනේ නම් ඒක කුෂ්ඨරෝගයය, ඒක දෑවාවූ තුවාලයෙන් හටගත්තේය. ඔහු අපවිත්‍රයයි පූජකයා\nකියයුතුය.',NULL,'20191031193740'),('Lev-13-25-0','Lev','SOV',26,13,26,0,'ඒක කුෂ්ඨරෝගයය. එහෙත් පූජකයා බැලූ කල පැල්ලමේ සුදු මයිල් නැතුව හමට වඩා පහත්නොවී මැලවී තිබුණොත් පූජකයා ඔහු සත් දවසක් වෙන්කර සිටුවිය\nයුතුය.',NULL,'20191031193740'),('Lev-13-26-0','Lev','SOV',27,13,27,0,'සත්වෙනි දින පූජකයා ඔහු බලාවා. ඒක හමේ පැතිර තිබේනම් ඔහු අපවිත්‍රයයි පූජකයා ප්‍රකාශකෙරේවා. ඒක කුෂ්ඨරෝගයය.',NULL,'20191031193740'),('Lev-13-27-0','Lev','SOV',28,13,28,0,'එහෙත් පල්ල පැතිර නොගොස්, තිබුණු තැනම නැවතී මැලවී තිබුණොත්, ඒක දෑවාවූ තුවාලයෙන් හටගත් ඉදිමුමය, පූජකයා ඔහු පවිත්‍රයයි ප්‍රකාශකළ\nයුතුය. ඒක තුවාලයේ කැලලය.',NULL,'20191031193740'),('Lev-13-28-0','Lev','SOV',29,13,29,0,'පුරුෂයෙකුට හෝ‍ ස්ත්‍රියෙකුට හෝ‍ හිසේ නොහොත් රැවුලේ ලපයක් තිබෙන විට,',NULL,'20191031193740'),('Lev-13-29-0','Lev','SOV',30,13,30,0,'පූජකයා ලපය බැලිය යුතුය. එවිට ඒක හමට වඩා පහත් බවද ඒකේ කහවන් සිහින් මයිල් තිබෙන බවද පෙනුණොත් පූජකයා ඔහු අපවිත්‍රයයි ප්‍රකාශකළ යුතුය.\nඒක කබොල්ලක්ය, හිසේ නොහොත් රැවුලේ කුෂ්ඨයක්ය.',NULL,'20191031193740'),('Lev-13-3-0','Lev','SOV',4,13,4,0,'නුමුත් ඔහුගේ ශරීරයේ හමෙහි තිබෙන පැල්ලම සුදු බවද හමට වඩා පහත්ව නැති බවද එහි මයිල් සුදු නොවී තිබෙන බවද පෙනේනම් පූජකයා රෝගකාරයා සත්\nදිනක් වෙන්කර සිටුවා,',NULL,'20191031193740'),('Lev-13-30-0','Lev','SOV',31,13,31,0,'නුමුත් පූජකයා කබලු ලකුණ බැලුවාම ඒක හමට වඩා පහත් බව නොපෙනුණොත්, ඒකේ කළු මයිල් නැතුව තිබුණොත්, පූජකයා කබලු ලපය ඇත්තා සත් දවසක් හිරකර\nසිටුවාවා.',NULL,'20191031193740'),('Lev-13-31-0','Lev','SOV',32,13,32,0,'සත්වෙනි දින ඔහු ලපය බලාවා. එවිට කබොල්ල පැතිර නොගොස් එහි කහවන් මයිල් නැතුව කබොල්ල හමට වඩා පහත් නැති බව පෙනේ නම්,',NULL,'20191031193740'),('Lev-13-32-0','Lev','SOV',33,13,33,0,'ඔහුගේ හිස මුඩුකරනු ලැබිය යුතුය, එහෙත් ලපය මුඩු නොකළ යුතුය; පූජකයා කබොල්ල ඇත්තා තවත් සත් දිනක් වෙන්කර සිටුවා තබාවා.',NULL,'20191031193740'),('Lev-13-33-0','Lev','SOV',34,13,34,0,'තවද සත්වෙනි දින පූජකයා ලපය බලාවා. එවිට කබොල්ල හමෙහි පැතිර නොගොස් හමට වඩා පහත්ව නැති බව පෙනුණොත් ඔහු පවිත්‍රයයි පූජකයා ප්‍රකාශ\nකෙරේවා. ඔහු තමාගේ වස්ත්‍ර සෝදාගෙන පවිත්‍රවන්නේය.',NULL,'20191031193740'),('Lev-13-34-0','Lev','SOV',35,13,35,0,'එහෙත් ඔහුගේ පවිත්‍රවීමෙන් පසු කබොල්ල හමේ පැතුරුණොත් පූජකයා ඔහු බලාවා.',NULL,'20191031193740'),('Lev-13-35-0','Lev','SOV',36,13,36,0,'එවිට කබොල්ල හමේ පැතිර තිබුණොත් පූජකයා කහපාට මයිල් ඇද්දැයි සොයන්ට ඕනෑ නැත; ඔහු අපවිත්‍රය.',NULL,'20191031193740'),('Lev-13-36-0','Lev','SOV',37,13,37,0,'එහෙත් කබොල්ල නැවතී එහි තුළ කළු මයිල් හටගැනී තිබෙන බව ඔහුට පෙනේනම් කබලුව සුවවී ඔහු පවිත්‍රව සිටී. පූජකයා ඔහු පවිත්‍රයයි\nප්‍රකාශකෙරේවා.',NULL,'20191031193740'),('Lev-13-37-0','Lev','SOV',38,13,38,0,'පුරුෂයෙකුට හෝ‍ ස්ත්‍රියෙකුට හෝ‍ ඔවුන්ගේ ශරීරයේ හමේ පල්ල එනම් සුදු පල්ල හටගත් කල්හි,',NULL,'20191031193740'),('Lev-13-38-0','Lev','SOV',39,13,39,0,'පූජකතෙමේ බලාවා; එවිට ඔවුන්ගේ ශරීරයේ හමේ සුදුමැලි පලු තිබෙන බව දුටුවොත් ඒවා හමේ හටගත් ගෝමරය; ඒ අය පවිත්‍රය. ‍',NULL,'20191031193740'),('Lev-13-39-0','Lev','SOV',40,13,40,0,'යමෙකුගේ හිසකේ වැටී ඔහු හිස මුඩුකෙනෙක් වුණත් ඔහු පවිත්‍රය.',NULL,'20191031193740'),('Lev-13-4-0','Lev','SOV',5,13,5,0,'සත්වෙනි දින ඔහු බලන්නේය; එවිට ඒ ලකුණ හමෙහි පැතිර නොගොස් නැවතී තිබෙන බව ඔහුට පෙනේනම් තවත් සත් දිනක් පූජකයා ඔහු වෙන්කොට සිටුවා,',NULL,'20191031193740'),('Lev-13-40-0','Lev','SOV',41,13,41,0,'යමෙකුගේ ඉස්සරහ පැත්තේ හිසකේ වැටී නළල මුඩු කෙනෙක් වුණත් ඔහු පවිත්‍රය.',NULL,'20191031193740'),('Lev-13-41-0','Lev','SOV',42,13,42,0,'නුමුත් මුඩු හිසේවත් මුඩු නළලේවත් රතට හුරු සුදු ලපයක් හටගත්තොත් එය ඔහුගේ මුඩු හිසෙහි හෝ‍ මුඩු නළලෙහි හෝ‍ හටගන්න කුෂ්ඨයක්ය.',NULL,'20191031193740'),('Lev-13-42-0','Lev','SOV',43,13,43,0,'එවිට පූජකයා ඔහු බලාවා. තවද ශරීරයේ හමේ කුෂ්ඨරෝගයේ පෙනීම වාගේ රතට හුරු සුදු කුෂ්ඨ ඉදිමුමක් ඔහුගේ මුඩු හිසේවත් මුඩු නළලේවත් තිබුණොත්,',NULL,'20191031193740'),('Lev-13-43-0','Lev'