ු ස්වාමීන්වහන්සේගේ සේවය බලා ගත්තෝය.',NULL,'20191031193929'),('Num-9-3-0','Num','SOV',4,9,4,0,'මෝසෙස්ද පාස්කුව පවත්වන්ට ඉශ්‍රායෙල් පුත්‍රයන්ට කීවේය.',NULL,'20191031193929'),('Num-9-4-0','Num','SOV',5,9,5,0,'එසේ ඔව්හු පළමුවෙනි මස දසසතරවෙනි දින සවස සීනයි කාන්තාරයේදී පාස්කුව පැවැත්වූහ. ස්වාමීන්වහන්සේ මෝසෙස්ට අණකළ සියල්ල ලෙස ඉශ්‍රායෙල්\nපුත්‍රයෝ කළෝය.',NULL,'20191031193929'),('Num-9-5-0','Num','SOV',6,9,6,0,'මෘත ශරීරයකින් අපවිත්‍රවී ඒ දවසේ පාස්කුව පවත්වන්ට නොහැකිවූ සමහර මනුෂ්‍යයෝ එහි සිටියෝය. ඒ මනුෂ්‍යයෝ ඒ දවසේදී මෝසෙස් සහ ආරොන් ඉදිරියට\nඅවුත් කථාකොට:',NULL,'20191031193929'),('Num-9-6-0','Num','SOV',7,9,7,0,'අපි මෘත ශරීරයකින් අපවිත්‍රවී සිටිමුව. ඉශ්‍රායෙල් පුත්‍රයන් අතරෙහි ස්වාමීන්වහන්සේගේ පූජාව ඊට නියම කාලයෙහි ඔප්පු කිරීමෙන් අප වලක්වනු\nලබන්නේ මක්නිසාදැයි ඔහුගෙන් ඇසුවෝය.',NULL,'20191031193929'),('Num-9-7-0','Num','SOV',8,9,8,0,'මෝසෙස්ද: ස්වාමීන්වහන්සේ නුඹලා ගැන අණකරන්නේ කුමක්දැයි දැනගන්න තෙක් සිටපල්ලායයි ඔවුන්ට කීවේය.',NULL,'20191031193929'),('Num-9-8-0','Num','SOV',9,9,9,0,'ස්වාමීන්වහන්සේ මෝසෙස්ට කථාකොට:',NULL,'20191031193929'),('Num-9-9-0','Num','SOV',10,9,10,0,'නුඹ ඉශ්‍රායෙල් පුත්‍රයන්ට මෙසේ කියාපන්න-නුඹලාගෙන්වත් නුඹලාගේ පරම්පරාවලින්වත් කිසිවෙකු මළ කඳකින් අපවිත්‍රව සිටින නුමුත් දුර ගමනක\nයෙදී සිටින නුමුත් ඔහු ස්වාමීන්වහන්සේට පාස්කුව පවත්වාවා.',NULL,'20191031193929');
